selector_to_html = {"a[href=\"#table-defuzzify-phrases\"]": "<table class=\"table\" id=\"table-defuzzify-phrases\">\n<caption><span class=\"caption-number\">Table 2.2 </span><span class=\"caption-text\">De-fuzzify phrase searches</span><a class=\"headerlink\" href=\"#table-defuzzify-phrases\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Query</p></th>\n<th class=\"head\"><p>Results</p></th>\n<th class=\"head\"><p>Explanation</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">white</span> <span class=\"pre\">OR</span> <span class=\"pre\">australia</span></code></p></td>\n<td><p><span class=\"pasted-text\">48,728,787</span></p></td>\n<td></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">white</span> <span class=\"pre\">australia</span></code></p></td>\n<td><p><span class=\"pasted-text\">5,731,896</span></p></td>\n<td><p>Same as white AND australia</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">\"white</span> <span class=\"pre\">australia\"</span></code></p></td>\n<td><p><span class=\"pasted-text\">159,498</span></p></td>\n<td><p>Search for phrase (with stemming)</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">text:\"white</span> <span class=\"pre\">australia\"</span></code></p></td>\n<td><p><span class=\"pasted-text\">155,242</span></p></td>\n<td><p>Search for phrase (no stemming &amp; ignores tags/comments)</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">\"white</span> <span class=\"pre\">australia\"~0</span></code></p></td>\n<td><p><span class=\"pasted-text\">159,498</span></p></td>\n<td><p>Search for phrase (with stemming, no extra words)</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">text:\"white</span> <span class=\"pre\">australia\"~0</span></code></p></td>\n<td><p><span class=\"pasted-text\">149,723</span></p></td>\n<td><p>Search for exact phrase (no extra words, no stemming, ignore tags/comments)</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#searching-for-articles-within-a-given-date-range\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.8. </span>Searching for articles within a given date range<a class=\"headerlink\" href=\"#searching-for-articles-within-a-given-date-range\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#table-date-index\"]": "<table class=\"table\" id=\"table-date-index\">\n<caption><span class=\"caption-number\">Table 2.7 </span><span class=\"caption-text\">Using the date index</span><a class=\"headerlink\" href=\"#table-date-index\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Query</p></th>\n<th class=\"head\"><p>Explanation</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">date:[1901</span> <span class=\"pre\">TO</span> <span class=\"pre\">1904]</span></code></p></td>\n<td><p>1 January 1901 to 31 December 1904</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">date:[*</span> <span class=\"pre\">TO</span> <span class=\"pre\">1904]</span></code></p></td>\n<td><p>before 31 December 1904</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">date:[1904</span> <span class=\"pre\">TO</span> <span class=\"pre\">1904]</span></code></p></td>\n<td><p>1 January 1904 to 31 December 1904</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">date:[1942-10-31T00:00:00Z</span> <span class=\"pre\">TO</span> <span class=\"pre\">1942-11-30T00:00:00Z]</span></code></p></td>\n<td><p>1 November 1942 to 31 November 1942 (newspapers only \u2013 dates need timezones, first date in range ignored)</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">date:[1942-11-09T00:00:00Z</span> <span class=\"pre\">TO</span> <span class=\"pre\">1942-11-10T00:00:00Z]</span></code></p></td>\n<td><p>10 November 1942 (newspapers only \u2013 dates need timezones, first date in range ignored)</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#table-defuzzify-keyword\"]": "<table class=\"table\" id=\"table-defuzzify-keyword\">\n<caption><span class=\"caption-number\">Table 2.1 </span><span class=\"caption-text\">De-fuzzify keyword searches</span><a class=\"headerlink\" href=\"#table-defuzzify-keyword\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Query</p></th>\n<th class=\"head\"><p>Results</p></th>\n<th class=\"head\"><p>Explanation</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">hobart</span></code></p></td>\n<td><p><span class=\"pasted-text\">5,829,407</span></p></td>\n<td><p>Searches article text, tags &amp; comments (some fuzziness, terms are stemmed)</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">hobart*</span></code></p></td>\n<td><p><span class=\"pasted-text\">5,899,072</span></p></td>\n<td><p>Searches article text, tags &amp; comments (more fuzziness, wildcard matches zero or more characters)</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">text:hobart</span></code></p></td>\n<td><p><span class=\"pasted-text\">5,545,527</span></p></td>\n<td><p>Searches article text only (exact match, ignores tags &amp; comments)</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">title:hobart</span></code></p></td>\n<td><p><span class=\"pasted-text\">718,236</span></p></td>\n<td><p>Searches headlines only</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#searching-for-articles-on-a-specific-page\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.7. </span>Searching for articles on a specific page<a class=\"headerlink\" href=\"#searching-for-articles-on-a-specific-page\" title=\"Permalink to this heading\">#</a></h2><p>You can use the <code class=\"docutils literal notranslate\"><span class=\"pre\">firstpageseq</span></code> index to search for articles published on a particular page. For example, include <code class=\"docutils literal notranslate\"><span class=\"pre\">firstpageseq:1</span></code> in your query to find articles on page one. This works in both the web interface\u2019s simple search box and the <code class=\"docutils literal notranslate\"><span class=\"pre\">q</span></code> value of the API.</p><p><a class=\"reference external\" href=\"https://troveconsole.herokuapp.com/v3/?url=https%3A//api.trove.nla.gov.au/v3/result%3Fq%3Dfirstpageseq%3A1%26category%3Dnewspaper%26encoding%3Djson&amp;comment=\"><img alt=\"Try it!\" src=\"https://troveconsole.herokuapp.com/static/img/try-trove-api-console.svg\"/></a></p>", "a[href=\"#using-indexes\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.5. </span>Using indexes<a class=\"headerlink\" href=\"#using-indexes\" title=\"Permalink to this heading\">#</a></h2><p>When you enter queries in the simple search box, or by using the <code class=\"docutils literal notranslate\"><span class=\"pre\">q</span></code> parameter in an API request, you\u2019re searching across most metadata fields and any available full text. To control where and what you\u2019re searching, you can specify the index you want Trove to use. For example, the query <code class=\"docutils literal notranslate\"><span class=\"pre\">title:wragge</span></code> will search only the <code class=\"docutils literal notranslate\"><span class=\"pre\">title</span></code> field for the term <code class=\"docutils literal notranslate\"><span class=\"pre\">wragge</span></code>.</p><p>Other indexes mentioned in <a class=\"reference external\" href=\"https://trove.nla.gov.au/help/searching/constructing-complex-search-query\">Trove\u2019s help documentation</a> are:</p>", "a[href=\"#table-proximity-modifiers\"]": "<table class=\"table\" id=\"table-proximity-modifiers\">\n<caption><span class=\"caption-number\">Table 2.4 </span><span class=\"caption-text\">Using proximity modifiers</span><a class=\"headerlink\" href=\"#table-proximity-modifiers\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Query</p></th>\n<th class=\"head\"><p>Results</p></th>\n<th class=\"head\"><p>Explanation</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">chinese</span> <span class=\"pre\">tasmania</span></code></p></td>\n<td><p><span class=\"pasted-text\">278,467</span></p></td>\n<td><p>articles contain both terms</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">\"chinese</span> <span class=\"pre\">tasmania\"~10</span></code></p></td>\n<td><p><span class=\"pasted-text\">4,144</span></p></td>\n<td><p>articles where \u2018tasmania\u2019 is within 10 words of \u2018chinese\u2019</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">\"tasmania</span> <span class=\"pre\">chinese\"~10</span></code></p></td>\n<td><p><span class=\"pasted-text\">4,160</span></p></td>\n<td><p>terms in reverse order are matched, but reversing counts towards the word distance so results can differ</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">\"tasmania</span> <span class=\"pre\">chinese\"~10</span> <span class=\"pre\">OR</span> <span class=\"pre\">\"chinese</span> <span class=\"pre\">tasmania\"~10</span></code></p></td>\n<td><p><span class=\"pasted-text\">4,657</span></p></td>\n<td><p>10 word distance in either direction</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#simple-search-isnt\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Simple search isn\u2019t!<a class=\"headerlink\" href=\"#simple-search-isnt\" title=\"Permalink to this heading\">#</a></h2><p>The Trove web interface distinguishes between \u2018Advanced\u2019 and \u2018Simple\u2019 search. This is a bit misleading as you can construct complex queries using either. \u2018Advanced\u2019 search really just adds a structured interface over the \u2018Simple\u2019 search options. This Guide focuses on using \u2018Simple\u2019 search because it gives you more control, exposes more of the workings of the search index, and its queries can be easily translated to work with the Trove API.</p><p>See <a class=\"reference external\" href=\"https://trove.nla.gov.au/help/searching/constructing-complex-search-query\">Constructing a complex search query</a> in the Trove help system for an introduction to:</p>", "a[href=\"#simple-search-options\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>\u2018Simple\u2019 search options<a class=\"headerlink\" href=\"#simple-search-options\" title=\"Permalink to this heading\">#</a></h1><p><mark>==Include a note about <code class=\"docutils literal notranslate\"><span class=\"pre\">firstpageseq</span></code> and the fact that this will match pages from supplements as well. So supplements need to be filtered out after harvesting. Also note that not all issues start with page 1.==</mark></p>", "a[href=\"date-searches.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">4. </span>Date searches<a class=\"headerlink\" href=\"#date-searches\" title=\"Permalink to this heading\">#</a></h1><p>You can limit your Trove searches by date in a number of ways. These options vary across categories and can cause confusion. This section will attempt to document the possibilities and problems.</p>", "a[href=\"../what-is-trove/collections.html#collections-ispartof-series\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id7\" role=\"doc-backlink\">Search the <code class=\"docutils literal notranslate\"><span class=\"pre\">isPartOf</span></code> field using the <code class=\"docutils literal notranslate\"><span class=\"pre\">series</span></code> index</a><a class=\"headerlink\" href=\"#search-the-ispartof-field-using-the-series-index\" title=\"Permalink to this heading\">#</a></h3><p>You can use the <code class=\"docutils literal notranslate\"><span class=\"pre\">series</span></code> index to search <code class=\"docutils literal notranslate\"><span class=\"pre\">isPartOf</span></code> values. It seems to only match records where the <code class=\"docutils literal notranslate\"><span class=\"pre\">isPartOf</span></code> type is <code class=\"docutils literal notranslate\"><span class=\"pre\">series</span></code>, but you can it\u2019s much more flexible than the <code class=\"docutils literal notranslate\"><span class=\"pre\">contribcollection</span></code> facet as it accepts partial matches and is case-insensitive. For example, a <a class=\"reference external\" href=\"https://trove.nla.gov.au/search/category/music?keyword=series%3A%22Australian%20women%20scientists%20oral%20history%20project%22\">search for <code class=\"docutils literal notranslate\"><span class=\"pre\">series:\"Australian</span> <span class=\"pre\">women</span> <span class=\"pre\">scientists</span> <span class=\"pre\">oral</span> <span class=\"pre\">history</span> <span class=\"pre\">project\"</span></code></a> returns 25 results \u2013 no need to worry about trailing full stops!</p><p><a class=\"reference external\" href=\"https://troveconsole.herokuapp.com/v3/?url=https%3A%2F%2Fapi.trove.nla.gov.au%2Fv3%2Fresult%3Fq%3Dseries%3A%22Australian+women+scientists+oral+history+project%22%26category%3Dmusic%26encoding%3Djson&amp;comment=\"><img alt=\"Try it!\" src=\"https://troveconsole.herokuapp.com/static/img/try-trove-api-console.svg\"/></a></p>", "a[href=\"#proximity-searches\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.4. </span>Proximity searches<a class=\"headerlink\" href=\"#proximity-searches\" title=\"Permalink to this heading\">#</a></h2><p>The defuzzify examples above use the proximity modifier (<code class=\"docutils literal notranslate\"><span class=\"pre\">~</span></code>) to remove extra words from a query, but you can also use it to set a maximum distance between search terms. One thing to note is that the order of the search terms makes a difference to your results, as reversing the order of your terms counts as a \u2018word\u2019. For example:</p>", "a[href=\"#table-stemming-oddities\"]": "<table class=\"table\" id=\"table-stemming-oddities\">\n<caption><span class=\"caption-number\">Table 2.3 </span><span class=\"caption-text\">Stemming variations</span><a class=\"headerlink\" href=\"#table-stemming-oddities\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Query</p></th>\n<th class=\"head\"><p>Results</p></th>\n<th class=\"head\"><p>Explanation</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">naturalisation</span></code></p></td>\n<td><p><span class=\"pasted-text\">245,114</span></p></td>\n<td><p>Stemmed to \u2018naturalis\u2019</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">naturalization</span></code></p></td>\n<td><p><span class=\"pasted-text\">15,260,449</span></p></td>\n<td><p>Stemmed to \u2018natur\u2019</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">text:naturalisation</span></code></p></td>\n<td><p><span class=\"pasted-text\">245,114</span></p></td>\n<td><p>No stemming</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">text:naturalization</span></code></p></td>\n<td><p><span class=\"pasted-text\">15,260,449</span></p></td>\n<td><p>No stemming</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"../newspapers-and-gazettes/data/pages.html#get-page-identifier-from-search\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id11\" role=\"doc-backlink\">Get the identifier of a specific page by searching for articles</a><a class=\"headerlink\" href=\"#get-the-identifier-of-a-specific-page-by-searching-for-articles\" title=\"Permalink to this heading\">#</a></h3><p>To get the identifier of a specific page, you need to construct a very precise search for articles published on that page using the <code class=\"docutils literal notranslate\"><span class=\"pre\">/result</span></code> endpoint. You can do this by specifying the title (the newspaper name), the publication date, and the page number. Once you have the search results, you can extract the page identifier from the article records.</p><p>The newspaper title is set using the <code class=\"docutils literal notranslate\"><span class=\"pre\">l-title</span></code> parameter. For example, the identifier for the <em>Canberra Times</em> is <code class=\"docutils literal notranslate\"><span class=\"pre\">11</span></code>, so to limit your search to the <em>Canberra Times</em> you\u2019d set <code class=\"docutils literal notranslate\"><span class=\"pre\">l-title</span></code> to <code class=\"docutils literal notranslate\"><span class=\"pre\">11</span></code>.</p>", "a[href=\"#stemming-oddities\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>Stemming oddities<a class=\"headerlink\" href=\"#stemming-oddities\" title=\"Permalink to this heading\">#</a></h2><p>As noted above, Trove stems your search terms, trimming them back to their base form. It seems that Trove uses the Porter stemming algorithm. If you\u2019d to see how stemming affects your query, you can use this <a class=\"reference external\" href=\"http://text-processing.com/demo/stem/\">online tool</a> to test the results of the Porter algorithm.</p><p>I\u2019ve noticed some oddities in handling <code class=\"docutils literal notranslate\"><span class=\"pre\">-ise</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">-ize</span></code> suffixes. For example:</p>", "a[href=\"#table-index-operators\"]": "<table class=\"table\" id=\"table-index-operators\">\n<caption><span class=\"caption-number\">Table 2.6 </span><span class=\"caption-text\">Using search operators with indexes</span><a class=\"headerlink\" href=\"#table-index-operators\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Query</p></th>\n<th class=\"head\"><p>Explanation</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">subject:history</span></code></p></td>\n<td><p>Search for a keyword in the <code class=\"docutils literal notranslate\"><span class=\"pre\">subject</span></code> index</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">subject:(history</span> <span class=\"pre\">weather)</span></code></p></td>\n<td><p>Search for multiple keywords in the <code class=\"docutils literal notranslate\"><span class=\"pre\">subject</span></code> index</p></td>\n</tr>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">subject:(history</span> <span class=\"pre\">NOT</span> <span class=\"pre\">australia)</span></code></p></td>\n<td><p>Search using boolean operators in <code class=\"docutils literal notranslate\"><span class=\"pre\">subject</span></code> index</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">subject:\"Australian</span> <span class=\"pre\">history\"</span></code></p></td>\n<td><p>Search for a phrase in the <code class=\"docutils literal notranslate\"><span class=\"pre\">subject</span></code> index</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#using-facets\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.6. </span>Using facets<a class=\"headerlink\" href=\"#using-facets\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#table-undocumented-search-indexes\"]": "<table class=\"table\" id=\"table-undocumented-search-indexes\">\n<caption><span class=\"caption-number\">Table 2.5 </span><span class=\"caption-text\">Undocumented search indexes</span><a class=\"headerlink\" href=\"#table-undocumented-search-indexes\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Index</p></th>\n<th class=\"head\"><p>Description</p></th>\n<th class=\"head\"><p>Example</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">series</span></code></p></td>\n<td><p><a class=\"reference internal\" href=\"../what-is-trove/collections.html#collections-ispartof-series\"><span class=\"std std-ref\">Search for resources that are part of a collection</span></a></p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">series:\"Parliamentary</span> <span class=\"pre\">paper</span> <span class=\"pre\">(Australia.</span> <span class=\"pre\">Parliament)</span></code> \u2013 find Parliamentary Papers</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">firstpageseq</span></code></p></td>\n<td><p>Search for newspaper articles published on a specific page</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">firstpageseq:2</span></code> \u2013 find articles published on page two</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#de-fuzzify-your-searches\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>De-fuzzify your searches<a class=\"headerlink\" href=\"#de-fuzzify-your-searches\" title=\"Permalink to this heading\">#</a></h2><p>By default, Trove adds a bit of fuzziness to your searches to try and ensure you get back some useful results. This includes:</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
